import './App.css';
import Video from './pages/Video';

function App() {
  return (
    <div className="App">
    <div className='app__videos'>
      <Video
      likrs={100}
      messagens={200} 
      shares={300}
      name="eumesmo"
      descrip
      />
      
    </div>
    </div>
  );
}

export default App;
